          "label": "var dataSourcePath = \"/home/mike/progr/repo/mm-vis-js/app/lisp.data.js\";\nvar url = \"https://localhost:3001\";\nvar canvasProjectName = \"lisp_proj1\";\nvar buildProjectName = \"lisp-tests\";\n\nif (typeof runProject !== \"undefined\") console.log(\"runProject: \" + runProject);\nif (typeof runProject === \"undefined\") runProject = \"false\";\nif (runProject != \"true\") runProject = \"false\";\n\nupdateMenuFromScheme([], []);\n\nvar data = document.getElementById(\"schemeDataTextArea\").value;\n\nfunction fetchData(url, params) {\n   url = url + \"?origin=*\";\n   Object.keys(params).forEach(function(key){url += \"&\" + key + \"=\" + params[key];});\n\n   fetch(url)\n       .then(function(response){return response.json();})\n       .then(function(response) {\n          if (typeof response === \"string\" && response.lastIndexOf(\"ok - \", 0) !== 0 ) {\n             showAlert(response, 30, 170);\n          }\n          if (typeof response === \"object\") {\n             console.log(\"buildProjectName: \" + response.buildProjectName);\n             if (response.stdoutVal != \"\")\n                console.log(\"response.stdoutVal: \" + response.stdoutVal);\n             if (response.stderrVal != \"\")\n                console.log(\"response.stderrVal: \" + response.stderrVal);\n             if (response.errorVal != \"\")\n                console.log(\"response.errorVal: \" + response.errorVal);\n             if (typeof response.runProjectCommandResult !== \"undefined\")\n                console.log(\"runProjectCommandResult: \" + response.runProjectCommandResult);\n                if (typeof selectedCodeNodeId !== \"undefined\") {\n                   var positions = network.getPositions();\n                   var nodeId = network.body.data.nodes.add([{\n                      label: response.runProjectCommandResult,\n                      x:positions[selectedCodeNodeId].x + 700,\n                      y:positions[selectedCodeNodeId].y\n                   }])[0];\n                }\n          } else {\n             console.log(\"Response: \" + response);\n          }\n       })\n       .catch(function(error){\n          console.log(error);\n   });\n}\n\nfunction chunkString(str, length) {\n  return str.match(new RegExp('(.|[\\r\\n]){1,' + length + '}', 'g'));\n}\n\ndata = encodeURIComponent(data);\nvar dataChunks = chunkString(data, 10000);\nconsole.log(dataChunks.length);\nvar saveTime = new Date();\n\nvar index = 0;\ndataChunks.forEach(function(dataChunk) {\n   dataChunk = encodeURIComponent(dataChunk);\n   var params = {\n       path: dataSourcePath,\n       dataPart: dataChunk,\n       dataPartNumber: index,\n       projectName: canvasProjectName,\n       saveTime: saveTime.getTime(),\n       dataChunksLength: dataChunks.length,\n       buildProjectName: buildProjectName,\n       lastDataPart: false,\n       runProject: runProject\n   };\n\n   fetchData(url, params);\n   index++;\n});\n",
