        "indx2_7220": {
          "id": "indx2_7220",
          "x": 112346,
          "y": 19351,
          "label": "(setf (symbol-function 'factorial)\n   (labels ((factorial (n)\n      (if (= n 0)\n         1\n         (* n (factorial (- n 1))))))\n   #'factorial))\n(factorial 5) => 120"
        },
