          "label": "I stumbled upon this article explaining the Y Combinator.\nThe code is in Scheme, but I'm trying to work through it using Common Lisp.\n\nHowever, I'm having trouble doing the translation from Scheme to Common Lisp.\nScheme uses a single namespace for both functions and (other) variables,\nbut Common Lisp uses different namespaces for functions and variables.\nHow can I resolve this difference, to get working Common Lisp code?",
